webpackJsonp([34793416483272],{5742:function(e,t){e.exports={data:{post:{html:"<p>17:15, and the pre-election shows are already running on TV. The pollsters are hoping that their first projections are as accurate as last year, when they were within 0.13% of the actual results for each party.</p>\n<p>Christopher was asleep, so he and I stayed home when Mama when to the fire station to vote. Our neighbor Achim was in charge there, and reported a record turnout (78% at 16:00). And yes, she voted differently than I would have.</p>",fields:{title:"Pre-Game Show",date:"22 Sep 2002",url:"https://papascott.de/2002-09-22-pre-game-show/"}}},pathContext:{slug:"/2002-09-22-pre-game-show/",prev:{fields:{title:"Misdiagnosis",date:"22 Sep 2002",slug:"/2002-09-22-misdiagnosis/"}},next:{fields:{title:"Day of Resignation",date:"23 Sep 2002",slug:"/2002-09-23-day-of-resignation/"}}}}}});
